Star Wars: The Clone Wars (2008)  

Verenigde Staten / Singapore
Animatie / Science-Fiction
98 minuten

geregisseerd door Dave Filoni
met de stemmen van Samuel L. Jackson, Anthony Daniels en Ian Abercrombie

De Clone War is in volle gang en Anakin Skywalker krijgt tegen z&amp;#039;n zijn zin in een leerlinge toegewezen. Samen met zijn Padawan wordt hij uitgezonden naar Tatooine om Jabba The Hutt te helpen zijn ontvoerde zoon te vinden. Maar Count Dooku ligt ook op de loer en is uit om de steun van Jabba The Hutt te winnen door de Jedi op te laten draaien voor de ontvoering.

